import OdooFleetVehicles from "./components/odooVeh";

function App() {
  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <h1 className="text-3xl font-extrabold text-center mb-8">
        Fleet Maintenance Tracker
      </h1>
      <OdooFleetVehicles />
    </div>
  );
}

export default App;
